import React from 'react';
import Header from './Header/Header';
import Main from './Main/Main';
import Footer from './Footer/Footer';
import PopupWithForm from './PopupWithForm';

function App() {
  return (
    <div className="page">
      <Header />
      <Main />
      <Footer />
      {/* <!--Попап Редактирование профиля --> */}
      <PopupWithForm className = 'popup popup_user_input popup_overlay' text = 'Редактировать профиль'/>
      {/* <!--Попап добавление изображений пользователем --> */}
      <PopupWithForm className = 'popup popup_image_content popup_overlay' text = 'Новое место'/>
      {/* <!-- Попап подтверждения удаления карточки --> */}
      <PopupWithForm className = 'popup popup_card_remove popup_overlay' text = 'Вы уверены?'/>
      {/* <!--Попап форма редактирования аватара --> */}
      <PopupWithForm className = 'popup popup_avatar_redact popup_overlay' text = 'Вы уверены?'/>
      {/* <!--Попап Масштабированное изображение --> */}
      <div className="popup popup_image_scale popup_overlay">
        <div className="popup__image-content">
          <button className="popup__close-button popup__close-button_image_scale" type="button"></button>
          <img className="popup__image-scale" src="#" alt="#"></img>
          <p className="popup__image-title">Карачаево-Черкесия</p>
        </div>
      </div>


    </div>
  );
}

export default App;
